// API để upload hình ảnh
app.post("/api/upload-image", upload.single("image"), (req, res) => {
  try {
    if (!req.file) {
      return res.status(400).json({ error: "Không có file được upload" });
    }
    const base64Image = req.file.buffer.toString("base64");
    const mimeType = req.file.mimetype;
    const imageDataUrl = `data:${mimeType};base64,${base64Image}`;
    res.json({ imageDataUrl });
  } catch (err) {
    console.error(err.stack);
    res.status(500).json({ error: "Lỗi khi upload hình ảnh" });
  }
});

// API để lấy danh sách huyện duy nhất từ place_headers
app.get("/api/huyen-list", async (req, res) => {
  try {
    const result = await pool.query(
      "SELECT DISTINCT huyen FROM place_headers ORDER BY huyen"
    );
    const huyenList = result.rows.map((row) => row.huyen);
    res.json(huyenList);
  } catch (err) {
    console.error(err.stack);
    res.status(500).json({ error: "Lỗi khi lấy danh sách huyện" });
  }
});

